    nav: `bg-blue-900 h-15 flex justify-between items-center p-4`,
    heading: `text-white text-3xl`
}

const Navbar = () => {

    const [user] = useAuthState(auth)
    console.log(user)
  return (
    <div className={style.nav}>
        <h1 className={style.heading}>Chat App</h1>
        {user ? <LogOut /> : <SignIn />}
    </div>
  )
}

export default Navbar
